class GetMenuModelClass {  bool? status;  Msg? msg;  GetMenuModelClass({this.status, this.msg});  GetMenuModelClass.fromJson(Map<String, dynamic> json) {    status = json['status'];    msg = json['msg'] != null ? new Msg.fromJson(json['msg']) : null;  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['status'] = this.status;    if (this.msg != null) {      data['msg'] = this.msg!.toJson();    }    return data;  }}class Msg {  String? tenantId;  List<Menu>? menu;  Msg({this.tenantId, this.menu});  Msg.fromJson(Map<String, dynamic> json) {    tenantId = json['tenantId'];    if (json['menu'] != null) {      menu = <Menu>[];      json['menu'].forEach((v) {        menu!.add(new Menu.fromJson(v));      });    }  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['tenantId'] = this.tenantId;    if (this.menu != null) {      data['menu'] = this.menu!.map((v) => v.toJson()).toList();    }    return data;  }}class Menu {  String? id;  String? name;  bool? showWeb;  bool? showMobile;  Menu({this.id, this.name, this.showWeb, this.showMobile});  Menu.fromJson(Map<String, dynamic> json) {    id = json['id'];    name = json['name'];    showWeb = json['showWeb'];    showMobile = json['showMobile'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['id'] = this.id;    data['name'] = this.name;    data['showWeb'] = this.showWeb;    data['showMobile'] = this.showMobile;    return data;  }}